import React, { Component } from 'react';

import '../styling/AboutMe.css'
class About extends Component {
    render() {
        return (
            <div className="aboutMe">
                <div className="profilePic">
                    <img src="otherImages/art_site_profile_pic.JPG" alt="Failed to load" />
                </div>
                <div>About me! About me! About me! About me! About me! About me! About me! About me! About me! About me! About me!</div>
            </div>
        );
    }
}

export default About;
